import Constants from 'expo-constants';

export default function Wallet() {
    _handleButtonPress = () => {
        Alert.alert(
            'Button pressed!',
            'You did it!',
        );
    };

   // render() {
        return (
            <View style={styles.container}>
                
                <View style={styles.topBox}>
                    <View style={styles.buttonContainer}>
                        <TouchableHighlight style ={styles.addButton}
                    onPress={() => {
                        alert('Card Added')
                    }}
                >
                        <Text style={styles.buttonText}>
                            Add Cards
                        </Text>
               
                        </TouchableHighlight>
                        <TouchableHighlight style={styles.rewardsButton}
                            onPress={() => {
                                alert('Your total Rewards is: ')
                            }}
                        >
                        
                            <Text style={styles.buttonText}>
                                Rewards
                            </Text>
                        </TouchableHighlight>
                        <TouchableHighlight style={styles.creditButton}
                            onPress={() => {
                                alert('Available Credit is: ')
                            }}
                        >
                            <Text style={styles.buttonText}>
                                Available Credit
                            </Text>
                        
                        </TouchableHighlight>
                    </View>
                </View>
                
                <View style={styles.bottomBox}>
                    
                    <View style={styles.buttonContainer2}>
                        <TouchableHighlight style ={styles.walletButton}
                    onPress={() => {
                        alert('You clicked on wallet')
                    }}
                >
                        <Text style={styles.buttonText}>
                            Wallet
                        </Text>
               
                        </TouchableHighlight>
                        <TouchableHighlight style ={styles.profileButton}
                    onPress={() => {
                        alert('You clicked on profile')
                    }}
                >
                        <Text style={styles.buttonText}>
                            Profile
                        </Text>
               
                        </TouchableHighlight>
                    </View>
                </View>
            </View>
        );
   // }
}

